// pages/components/question/question.js
Component({
  /**
   * 组件的属性列表
   */
  properties: {

  },

  /**
   * 组件的初始数据
   */
  data: {
    answerUrls: [
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,'
    ],
    answer: '',
    result: true,
    answerId: 1
  },

  /**
   * 组件的方法列表
   */
  methods: {
    onAnswer(e) {
      this.setData({
        result: false,
        answer: this.data.answerUrls[+e.currentTarget.dataset.id],
        answerId: e.currentTarget.dataset.id
      })
    },
    onRetry() {
      this.setData({
        result: true
      })
    },
    goRotate() {
      this.triggerEvent('changepage');
    }
  }
})